package aoc2018;

public class Day5 {
    public static void main(String[] args) {
        a();
        b();
    }

    private static void b() {
        String data = INPUT;
        int minLength = Integer.MAX_VALUE;
        for (char ignored = 'a'; ignored <= 'z' ; ignored++) {
            Stack stack = new Stack();
            for (int i = 0; i < data.length(); i++) {
                char c = data.charAt(i);
                if (Character.toLowerCase(c) != ignored) {
                    char otherCase = Character.isLowerCase(c) ? Character.toUpperCase(c) : Character.toLowerCase(c);
                    if (stack.peek() == otherCase) {
                        stack.pop();
                    } else {
                        stack.push(c);
                    }
                }
            }
            minLength = Math.min(minLength, stack.ix);
        }

        System.out.println(minLength);
    }

    private static void a() {
        Stack stack = new Stack();
        String data = INPUT;
        for (int i = 0; i < data.length(); i++) {
            char c = data.charAt(i);
            char otherCase = Character.isLowerCase(c) ? Character.toUpperCase(c) : Character.toLowerCase(c);
            if (stack.peek() == otherCase) {
                stack.pop();
            } else {
                stack.push(c);
            }
        }
        System.out.println(stack.ix);
    }

    private static class Stack {
        private char[] chars = new char[50_000];
        private int ix = 0;

        void push(char c) {
            chars[ix++] = c;
        }

        char peek() {
            return ix == 0 ? '\0' : chars[ix -1];
        }

        void pop() {
            if (ix > 0) {
                ix--;
            }
        }
    }
    private static final String INPUT_TEST = "dabAcCaCBAcCcaDA"; // 10
    private static final String INPUT = "";
}
